// ContentWindow.js
import React from 'react';

const ContentWindow = ({ selectedComponent }) => {
    return (
        <div>
            {selectedComponent === 'games' && <div>Содержимое компонента 1</div>}
            {selectedComponent === 'settings' && <div>Содержимое компонента 2</div>}
            {/* Добавьте отображение других компонентов по мере необходимости */}
        </div>
    );
};

export default ContentWindow;
